import React from "react";
import { Link } from "react-router-dom";

const CreateProjectButton = () => {
  return (
    <React.Fragment>
      <link to="/addProject" className="btn btn-lg btn-info">
        Create a Project
      </link>
    </React.Fragment>
  );
};
export default CreateProjectButton;
